import React from "react";

interface AddRowButtonProps {
  handleAddRowAtIndex: (index: number) => void;
}

export default function AddRowButton({
  handleAddRowAtIndex,
}: AddRowButtonProps) {
  return (
    <button
      className="w-24 h-7 border-2 bg-green-200 border-solid border-zinc-700 text-center"
      onClick={() => handleAddRowAtIndex(0)}
    >
      Add Row
    </button>
  );
}
